```C
void * state = gsl_rng_state (r);
size_t n = gsl_rng_size (r);
fwrite (state, n, 1, stream);
```

This function returns a pointer to an array of all the available generator types, terminated by a null pointer.
The function should be called once at the start of the program, if needed. The following code fragment shows how to iterate over the array of generator types to print the names of the available algorithms,

```Rust
let t = RngType::types_setup ();

println!("Available generators:");
for tmp in t.iter() {
    println!("{}", tmp.name);
}
```

This routine computes the power x^n for integer n. The power is computed using the minimum number of multiplications.
For example, x^8 is computed as ((x^2)^2)^2, requiring only 3 multiplications.
For reasons of efficiency, these functions do not check for overflow or underflow conditions.

```Rust
use rgsl::power;
/* compute 3.0**12 */
double y = gsl_sf_pow_int(3.0, 12);
```

